import React, { Component } from "react";
import { observer, inject } from "mobx-react";
import kakaomap from "../seehomodule/kakaomap";

@inject("pos")
@observer
class Mask extends Component {
  render() {
    console.log("hi");
    const { pos } = this.props;
    return (
      <div className="main">
        <div>
          {pos.getPosition2()}
          <h1>
            {pos.mylat}, {pos.mylng}
          </h1>
        </div>
        <Fragment>
          <kakaomap />
        </Fragment>
      </div>
    );
  }
}

export default Mask;
